<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8">
    <link rel="stylesheet" href="css/normalize.css">
    <link rel="stylesheet" href="octicons/octicons.css">
    <link rel="stylesheet" href="css/main.css">
    <title>Julie's GitHub Page</title>
  </head>
  <body>
    <header>
      <div class="head">
        <a href="http://www.github.com"><span class="mega-octicon octicon-mark-github"></span></a>
        <input type="search" id="search"name="name" value="Search GitHub">
        <ul class="global-nav">
          <li><a href="https://github.com/pulls">Pull Requests</a></li>
          <li><a href="https://github.com/issues">Issues</a></li>
          <li><a href="https://gist.github.com/">Gists</a></li>
        </ul>
        <ul class="user-nav">
          <li><a href="https://github.com/notifications"><span class="octicon octicon-inbox"></span></a></li>
          <li><a href="https://github.com/new"><span class="octicon octicon-plus left"></span><span class="octicon octicon-triangle-down"></span></a></li>
          <li class="nav-profile"></li>
        </ul>
      </div>
    </header>
    <div class="wrapper">
      <aside class="sidebar">
        <div class="image">
        </div>
        <div class="person">
        </div>
        <div class="meta">
        </div>
        <div class="inter">
        </div>
      </aside>
      <main class="repos">

      </main>
    </div>
    <footer class="footer">

    </footer>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/moment.js/2.10.3/moment.min.js"></script>
  <script src="http://code.jquery.com/jquery-1.11.3.min.js"></script>
  <script src="main.js"></script>
  </body>
</html>
